import React from 'react'
import 'react-slideshow-image/dist/styles.css'
import { Fade, Zoom, Slide } from 'react-slideshow-image'

const divStyle = {
    display: 'flex',
    alignItems: "center",
    justifyContent: "center",
    height: "400px",
    backgroundSize: 'cover'
}

const spanStyle = {
    fontSize: "20px",
    background: "efefef",
    color: "#000000"
}

const slideImages = [
    'images/slide_2.jpg',
    'images/slide_3.jpg',
    'images/slide_4.jpg',
    'images/slide_5.jpg',
    'images/slide_6.jpg',
    'images/slide_7.jpg'
  ];


const ImageSlider = () => {
    return (
        <div className="slide-container">
          <Zoom scale={0.4}>
            {
              slideImages.map((each, index) => <img key={index} style={{width: "100%"}} src={each} />)
            }
          </Zoom>
        </div>
      )
}

export default ImageSlider;
